(13, NULL, '', 'Nice Phone.', '2011-12-24 02:12:00', 410, 1, 27, '0'),
(11, NULL, '', 'I Like it Yaar.Nice Phone with dual SIM.', '2011-09-18 22:09:22', 87, 1, 1, '0'),
(10, NULL, '', 'With low Budget nice phone by samsung', '2011-08-26 22:08:56', 106, 1, 1, '0'),
(9, NULL, '', 'Nice Phone by Nokia with Wifi :)', '2011-08-23 05:08:28', 73, 1, 6, '0'),
(14, NULL, '', 'As 3D is taking over theaters and living rooms around the world, the craze is hitting handheld too.\r\nNice Phone yaar I really like it.', '2012-01-02 18:01:30', 539, 1, 27, '0'),
(15, NULL, '', 'As 3D is taking over theaters and living rooms around the world, the craze is hitting handheld too. The next thing to shake up the business or on the way to irrelevance: geeks will geek about it either way. Now that the HTC EVO 3D has grown a GSM radio, they get ready to enjoy a real 3D clash of the flagships. It doesnâ€™t get any better than two heavyweight fighters battling it out, and someoneâ€™s got the 3D video to prove it. ', '2012-01-02 18:01:09', 539, 1, 27, '0'),
(16, NULL, '', 'As 3D is taking over theaters and living rooms around the world, the craze is hitting handheld too. \r\nMast Phone Yaar.', '2012-01-02 18:01:22', 549, 1, 27, '0'),
(17, 'Mistry Sandip', 'sandip@indoushosting.com', 'The mobile phone type of this LG GM360i is bar. It has a weight of 95g g. It is a really light mobile phone. Dimensions of this mobile phone are around 108 X 53.1 X 11.95 mm. The battery power of LG GM360i which is liion900mAh provide a talk-time up to 8 hours 15 minutes hours.', '2012-01-03 12:01:23', 354, 1, NULL, '0'),
