(21, 'mistry Sandi', 'sandip@indoushosting.com', 'as i can see on the page it says that it was already on the OS6 but mine right now is on OS5 is it working if I upgrade my BB8520 to OS6 now from OS5?? anyone who knows the answer just send a reply..thanks! :)', '2012-01-05 10:01:41', 157, 1, NULL, '0'),
(22, 'Nilesh Parghi', 'nilesh@indoushosting.com', 'You gotta have Blackberry Desktop software installed on your computer. Once you have connected your blackberry onto your computer, run Blackberry Desktop Software and from there you can download, delete languages as well as other programs installed on your handset. It is not a complicated procedure and the software is free and available on Blackberry website.', '2012-01-05 10:01:49', 157, 1, NULL, '0'),
(23, 'Masud Vorajee', 'masud@indouashopsting.com', 'i like this phone very much.', '2012-01-05 11:01:27', 157, 1, NULL, '0'),
